import React from "react";
import alunos from "../../data/alunos";
export default props => {

    console.log(alunos);
const li = <li>{alunos[0].id} {alunos[0].nome} -> {alunos[0].nota}</li>
    return(
        <div>
            <ul>
                <li>Ana -9,1</li>
                <li>Carlos - 7,8</li>
                <li>Daniel - 5.3</li>
            </ul>
        </div>
    )
}
